  margin: 0;
  border: 1px solid hsl(210deg 8% 90%);
  border-radius: 3px 3px 3px 3px;
  background-color: #ffffff;
  margin-top: 150px;
  margin-left: -15px;
  box-shadow: 0 5px 18px -7px rgba(0, 0, 0, 0.1);

  > h2 {
    font-size: 15px;
    border-bottom: 1px solid hsl(210deg 8% 90%);
    font-weight: 400;
    padding: 12px;
    background-color: hsl(210deg 8% 98%);
  }
  > p {
    font-size: 12px;
    padding: 10px;
    margin: 10px;
  }
`;

const TagScript = styled.div`
  padding: 0;
  margin: 0;
  border: 1px solid hsl(210deg 8% 90%);
  border-radius: 3px 3px 3px 3px;
  background-color: #ffffff;
  margin-top: 65px;
  margin-left: -15px;
  box-shadow: 0 5px 18px -7px rgba(0, 0, 0, 0.1);

  > h2 {
    font-size: 15px;
    border-bottom: 1px solid hsl(210deg 8% 90%);
    font-weight: 400;
    padding: 12px;
    background-color: hsl(210deg 8% 98%);
  }
  > p {
    font-size: 12px;
